# Removing HTML
def remove_html(text):
    soup = BeautifulSoup(text, "lxml")
    html_free = soup.get_text()
    return html_free


# Remove punctuation
def remove_punctuation(text):
    no_punct = "".join([c for c in text if c not in string.punctuation])
    return no_punct


# Tokenize
def tokenizer(text):
    tokenizer = RegexpTokenizer(r'\w+')
    return tokenizer.tokenize(text.lower())


# Remove stopwords
def remove_stopwords(text):
    stop_words = stopwords.words('english')
    return [s for s in text if s not in stop_words]


# Lemmatize
def lemmatize(text):
    lemmatizer = WordNetLemmatizer()
    return [lemmatizer.lemmatize(l) for l in text]


# Part-of-Speech Analysis
def pos_tagging(text):
    return nltk.pos_tag(text)


# Sentiment Analysis
def sentiment_score(text):
    sia = SentimentIntensityAnalyzer()
    # add check for "language" variable here.
    sentiment_dict = sia.polarity_scores(text)
    return sentiment_dict['compound']


# Standardizer
def standardize(values):
    scaler = preprocessing.scale(values)
    return scaler

def crossval(clf, x_train, y):
    scores = cross_validate(clf, x_train, y)
    print("\nCross Validation Scores ->", scores["test_score"])

def we_will_roc_you(fper, tper, axes, title):
    axes.plot(fper, tper, color='red', label='ROC')
    axes.plot([0, 1], [0, 1], color='green', linestyle='--')
    if title == "K-Nearest-Neighbors Classifier" or title == "K-Nearest-Neighbors tf-idf Classifier":
        axes.set(ylabel='True Positive Rate', xlabel="False Positive Rate", title=title)
        print("0")
    else:
        axes.set(ylabel='True Positive Rate', xlabel="", title=title)
        axes.set_xticks([])
        print("1")





